      function drawChart() {
        var demoArr = [['timestamp','Patient Glucose','Population Average','Patient Average']];
        var userID;
        var timestamp;
        var glucose;
        var patSum = 0;
        var popSum = 0;
        var patAvg;
        var patCount = 0;
        var popAvg;

        for (var i = 0; i < demoPatient.length; i++) {
          popSum = popSum + demoPatient[i].glucose_reading;
          if (demoPatient[i].user_id == 517) {
            patCount += 1;
            patSum = patSum + demoPatient[i].glucose_reading;
          }
        }

        patAvg = patSum / patCount;
        popAvg = popSum / demoPatient.length;

        for (var i = 0; i < demoPatient.length; i++) {
          userID = demoPatient[i].user_id;
          timestamp = demoPatient[i].timestamp;
          glucose = demoPatient[i].glucose_reading;
          if (userID == 517 && timestamp.split("/")[0] == 4) {
            demoArr.push([demoPatient[i].timestamp, demoPatient[i].glucose_reading, popAvg, patAvg]);
          }
        }

        var data = google.visualization.arrayToDataTable(demoArr);
          //['Year', 'Sales', 'Expenses'],
          //['2004',  1000,      400],
          //['2005',  1170,      460],
          //['2006',  660,       1120],
          //['2007',  1030,      540]

          var options = {
            title: 'Sample Patient Monthly Glucose Levels',
            curveType: 'function',
            legend: { position: 'bottom' }
          };

          var chart = new google.visualization.LineChart(document.getElementById('curve_chart'));

          chart.draw(data, options);
        }
